import {Link} from 'react-router-dom'
const DUMMY_EVENTS = [
  {
    id: "1",
    title: "First event",
  },
  {
    id: "2",
    title: "Second event",
  },
];
const EventsPage = () => {
  return (
    <div>
      <h1>EventPage</h1>
      <ul>
        {DUMMY_EVENTS.map((item) => (
          <li>
            <Link to={item.id}>{item.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EventsPage;
